import React from 'react';
import { Link } from 'react-router-dom';

const Navbar = () => {
  const handleClick = (event) => {
    event.preventDefault();
    console.log('Clicked on:', event.target.textContent);
  };

  return (

    <nav class="navbar navbar-expand-lg navbar-light bg-light">
  <div class="container-fluid">
  
  <Link to="/" class="navbar-brand">fierce web</Link>

  <button class="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
    <span class="navbar-toggler-icon"></span>
  </button>

  <div class="collapse navbar-collapse" id="navbarSupportedContent">
    <ul class="navbar-nav me-auto mb-2 mb-lg-e">
      <li class="nav-item">
        <Link to="/" class="nav-link active">Home</Link>
      </li>
      <li class="nav-item">
        <Link to="/product" class="nav-link active">Product</Link>
      </li>
      <li class="nav-item">
        <Link to="/review" class="nav-link active">Review</Link>
      </li>
      <li class="nav-item">
        <Link to="/wishlist" class="nav-link active">Wishlist</Link>
      </li>
      <li class="nav-item">
        <Link to="/create-account" class="nav-link active">Creat account</Link>
      </li>
      <li class="nav-item">
        <Link to="/order" class="nav-link active">Order</Link>
      </li>
    </ul>
    
  </div>
  </div>
</nav>
  
   
  );
}

export default Navbar;
